mapper.select:
 SELECT 'S' AUD, IDX,ID,PW,NAME,AUTH,TEL_NO,REMARK,USE_YN
	  FROM mb_subject
	 WHERE ID = #{value}

mapper.insert:
insert into mb_subject
(id, pw, name, auth, tel_no, remark, use_yn)
values (#{userid}
		, #{userpw}
		, #{username}
		, #{userauth}
		, #{usertelno}
		, #{userremark}
		, #{useruseyn}
		)

mapper.update:
update mb_subject
   set pw=#{userpw}
   		, name=#{username}
   		, auth=#{userauth}
   		, tel_no=#{usertelno}
   		, remark=#{userremark}
   		, use_yn=#{useruseyn}
 where id=#{userid}
   and 1=1

mapper.select:
select count(*) from mb_pempower
 where puserid = #{puserid}
   and UPPER(progid) = #{progid}

mapper.update:
update mb_pempower
   set modifyusid=#{modifyusid}
   		, modifydate=DATE_FORMAT(sysdate(), '%Y%m%d%h%i%s%p')
 where puserid=#{puserid}
   and UPPER(progid)=#{progid}
   and 1=1

mapper.delete:
delete from mb_nrcdpower
 where userid=#{userid}
   and UPPER(progid)=#{progid}
   and userid_fr=#{useridFr}
   and 1=1

mapper.select:
SELECT 'S' AUD, KDCD,CDBS,CDNM,SORTNO,UNUSEYN,DESC1,DESC2,DESC3,MODIFYUSID,MODIFYDATE
  FROM mb_etccd
 WHERE KDCD = #{kdcd}


	 	${orderby}


		 ORDER BY CDBS

mapper.update:
update mb_etccd set CDNM=#{nm}, SORTNO=#{sno}, UNUSEYN=#{uyn}, DESC1=#{d1}, DESC2=#{d2}, DESC3=#{d3}
 where KDCD=#{selcode} and CDBS=#{bs}
   and 1=1

update mb_proglist set progcd01=#{cd1}, progcd02=#{cd2}, progcd03=#{cd3}, progid=#{pid}, progname=#{pname}, useyn=#{puseyn}
 where idx = #{k}
   and 1=1

